import React from 'react';
import './learnmorebtn.css';

const LearnMoreBtn = () => {
  return (
    <>
    <div className="learnMoreBtnDiv">
        <input type="button" value="Learn More" className='learnMoreBtn'/>
    </div>
    </>
  )
}

export default LearnMoreBtn
